'''Nathalie Joanne Emmanuel''' (born 2 March 1989) is a British actress, best known for her recurring role on the soap opera ''[[wikipedia:Hollyoaks|Hollyoaks]]''.

Via Twitter, Emmanuel revealed she would be working on the [[Season 3|third season]] of ''[[Game of Thrones]]''. She tweeted a picture of a the front page of the script for the sixth episode of the season. At the San Diego Comic-Con on 13 July 2012, it was confirmed that she would be playing the role of [[Missandei]].&lt;ref&gt;[http://www.youtube.com/watch?v=rpSDSgChsaI HBO's YouTube announcement]&lt;/ref&gt;

Nathalie Emmanuel joined the TV series as a recurring cast member in Season 3, and continued as a recurring cast member into Season 4. In February 2014, it was announced that Emmanuel will be promoted to Regular Cast Member in Season 5.&lt;ref&gt;&quot;[http://winteriscoming.net/2014/02/nathalie-emmanuel-promoted-to-series-regular-for-season-5/]&lt;/ref&gt;

Emmanuel first caught Benioff and Weiss's eyes when they saw her work in ''Misfits''.&lt;ref&gt;[http://www.denofgeek.us/tv/game-of-thrones/243771/67-things-you-didnt-know-about-game-of-thrones-season-4 ]&lt;/ref&gt;

